import React, { Component } from 'react';
import './index.css';

class initialProfile extends Component {
	constructor(props) {
		super(props);
		this.state = {
			gender: '',
			secualPreference: '',
			biography: '',
		}
	}

	render() {
		return (
			<div>
				<div>Tell Us More about Yourself</div>
			</div>
		)
	}
}

export default initialProfile;
